import { Fragment } from "react";
import glassCoffe from "../../../assets/glassCoffe.jpg";
import torta from "../../../assets/torta.jpg";

const Images = (props) => {
  return (
    <Fragment>
      <img src={glassCoffe}></img>
      <img src={torta}></img>
    </Fragment>
  );
};

export default Images;
